import { useSelector } from 'react-redux';

import { FormContainer, ContentCard, NameCard } from './style';
import OrderResultCard from '../OrderResultCard'
const { dinnerId, dinnerName, dinnerStyle, option,
    special, price, stylePrice, optionPrice, time } = useSelector(state => state.order);

const ResultPage = () => {
    return (
        <FormContainer>
            <NameCard style={{alignSelf: 'flex-start'}}>주문내역</NameCard>
            <OrderResultCard />
        </FormContainer>
    );
};

export default ResultPage;
